webpackJsonp([0x6d7b2645552f],{457:function(e,a){e.exports={data:{markdownRemark:{html:'<p><img src="/logo-5d5d9eefa31e5e13a6610d9fa7a283bb.svg"></p>\n<p>I’ve been doing lots of work in React and React Native lately. I put on a workshop through ACM@KU this week to share some of the knowledge I’ve gained using these frameworks.</p>\n<p><a href="https://github.com/e-nichols/KU-ACM-Learning-React">Here’s a link to the Github repo.</a>. The presentation slides are in the “slides” folder. It covers the basics: declarative vs. imperative programming, components, props, state, render(), and a bunch of examples. Enjoy!</p>',timeToRead:1,tableOfContents:"",fields:{tagSlugs:["/tags/ku-acm/","/tags/react/","/tags/workshop/"]},frontmatter:{title:"KU ACM React Workshop",tags:["KU ACM","React","workshop"],date:"February 08, 2017",author:{id:"Evan Nichols",bio:"Software Engineer out of NYC writing about programming, web development and more.",avatar:{children:[{__typename:"ImageSharp",responsiveResolution:{src:"/static/evan-9e6a6b67e58d77cd1bc023a71bd56378-c4f5a.jpg",srcSet:"/static/evan-9e6a6b67e58d77cd1bc023a71bd56378-c4f5a.jpg 1x,\n/static/evan-9e6a6b67e58d77cd1bc023a71bd56378-27112.jpg 1.5x,\n/static/evan-9e6a6b67e58d77cd1bc023a71bd56378-f5e46.jpg 2x,\n/static/evan-9e6a6b67e58d77cd1bc023a71bd56378-592c8.jpg 3x"}}]}}}}},pathContext:{slug:"/posts/ku-acm-react-workshop/"}}}});
